import EditableTable from '../components/table/EditableTable';
import Modall from '../components/Modal/Modall';
import React, { useState, useEffect } from 'react';

function JobApp(props) {
  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };
  return (
    <>
      <EditableTable
        showSelect="none"
        JobLink="Job applications"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        status="status"
      />
      <Modall showModal={showModal} handleOk={handleOk} handleCancel={handleCancel}/>
    </>
  );
}

export default JobApp;
